// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Auction {
    struct AuctionItem {
        address maker;
        string offerDetails;
        uint256 endTime;
        address highestBidder;
        uint256 highestBid;
        bool ended;
    }

    uint256 public auctionCounter;
    mapping(uint256 => AuctionItem) public auctions;

    event AuctionCreated(uint256 auctionId, address indexed maker, string offerDetails, uint256 endTime);
    event BidPlaced(uint256 auctionId, address indexed bidder, uint256 amount);
    event AuctionEnded(uint256 auctionId, address indexed winner, uint256 amount);

    modifier notEnded(uint256 _auctionId) {
        require(block.timestamp < auctions[_auctionId].endTime, "Auction has already ended");
        _;
    }

    modifier onlyEnded(uint256 _auctionId) {
        require(block.timestamp >= auctions[_auctionId].endTime, "Auction has not ended yet");
        _;
    }

    function createAuction(string memory _offerDetails, uint256 _duration) external {
        require(_duration > 0, "Duration must be greater than 0");

        auctionCounter++;
        auctions[auctionCounter] = AuctionItem({
            maker: msg.sender,
            offerDetails: _offerDetails,
            endTime: block.timestamp + _duration,
            highestBidder: address(0),
            highestBid: 0,
            ended: false
        });

        emit AuctionCreated(auctionCounter, msg.sender, _offerDetails, auctions[auctionCounter].endTime);
    }

    function bid(uint256 _auctionId, uint256 _amount) external notEnded(_auctionId) {
        AuctionItem storage auction = auctions[_auctionId];
        require(_amount > auction.highestBid, "Bid must be higher than current highest bid");

        auction.highestBidder = msg.sender;
        auction.highestBid = _amount;

        emit BidPlaced(_auctionId, msg.sender, _amount);
    }

    function endAuction(uint256 _auctionId) external onlyEnded(_auctionId) {
        AuctionItem storage auction = auctions[_auctionId];
        require(!auction.ended, "Auction has already been ended");

        auction.ended = true;

        emit AuctionEnded(_auctionId, auction.highestBidder, auction.highestBid);
    }
}

